import React , {Component} from 'react';
import podgruz from "./ajaxVideo";
// import Videoapp  from './videoPOTOCK.js';
import './styleBody.css';
export default class BodyVideo extends Component{
	constructor(props){
		super(props)
		this.state = {
			ClassNameStrel : {
				_1: [true, podgruz()[0] , {recomend:true}],
				_2: [false, 0, {translation:false}],
				_3: [false, 0, {serch_kanal:false}],
				_4: [false, 0, {podpis:false}],
				_5: [false, 0, {create_pl:false}],
				_6: [false, 0, {video_frend:false}],
				_7: [false, 0, {pozje:false}],
				_8: [false, 0, {history:false}],
				_9: [false, 0, {izbran:false}],
				_10: [false, 0, {my_post: false}]
			},
			// ClassNameBlockVideo :{
			// 	recomend:true,
			// 	translation:false,
			// 	serch_kanal:false,
			// 	podpis:false,
			// 	create_pl:false,
			// 	video_frend:false,
			// 	pozje:false,
			// 	history:false,
			// 	izbran:false,
			// 	my_post:false
			// }
		}
		this.usstr = this.usstr.bind(this)
	}
	grid__video__system(){
		return 2
	}
	usstr(e){
		let index     = e.target.id,
			keyTrue   = 0,
		    toggl;
		    if (this.state.ClassNameStrel[index][0]) {
		    	toggl = false
			} else if (this.state.ClassNameStrel[index][0] == false){
		    	toggl = true
			}
			for (const key in this.state.ClassNameStrel) {
				if (this.state.ClassNameStrel[key][0] == true) {
				keyTrue+=1
				}
				if (keyTrue >= 1){
				this.state.ClassNameStrel[key][0] = false
				}
				
			 }
		this.state.ClassNameStrel[index][0] = toggl
		//video block
	
		// for (const key in this.state.ClassNameBlockVideo) {
		// 	if (index == ) {
		// 		if (this.state.ClassNameStrel[index][0] == false) {
		// 			this.state.ClassNameBlockVideo[key] = false
		// 		} else if (this.state.ClassNameStrel[index][0] == true) {
		// 			this.state.ClassNameBlockVideo[key] = true
		// 		}

		// 	}
		// 	if (this.state.ClassNameStrel['_1'][0] == false) {
		// 		this.state.ClassNameBlockVideo.recomend = false
		// 	}
		// }
			
			 
		// console.log(this.state.ClassNameBlockVideo.recomend)
		// console.log(this.state.ClassNameStrel)

		this.setState(function (prevState, props) {
				return { ClassNameStrel: this.state.ClassNameStrel,
					ClassNameBlockVideo: this.state.ClassNameBlockVideo
				}
		});
		e.stopPropagation()
	}

	render(){
		return(
			<section className="sec__body">
				<div className="sec__body__spis_one">

					<div className="sec__body__spis_one___rec"  >
						<div className="sec__body__spis_one___rec_icon_1"></div>
						<a href="#">Рекомендации</a>
						<div id="_1" className={this.state.ClassNameStrel._1[0] == true ? "sec__body__spis_one___rec_us active__icon" :"sec__body__spis_one___rec_us "} 
						             onClick={this.usstr}></div> 

						<div className={this.ClassNameStrel[_10][2][recomend] ? "video__block__open" : "video__block__close"} style={{height:this.state.ClassNameStrel._1[1]}}>
							{this.grid__video__system()}
						</div>
					</div>

					<div className="sec__body__spis_one___tra">
						<div className="sec__body__spis_one___rec_icon_2"></div>
						<a href="#">Трансляции</a>
						<div id="_2" 
							className={this.state.ClassNameStrel._2[0]  ? "sec__body__spis_one___rec_us_l  active_icon_two" : "sec__body__spis_one___rec_us_l"}
									onClick={this.usstr} 
							 ></div>

						<div className={this.ClassNameStrel[_10][2][translation] ? "video__block__open" : "video__block__close"} style={{ height: this.state.ClassNameStrel._2[1] }}>
							{this.grid__video__system()}
						</div>
					</div>

					<div className="sec__body__spis_one___sech">
						<div className="sec__body__spis_one___rec_icon_3"></div>
						<a href="#">Найти канал</a>
						<div id="_3" className={this.state.ClassNameStrel._3[0]  ? "sec__body__spis_one___rec_us nejdan active__icon active_str_n" : "sec__body__spis_one___rec_us pasiv_us_strel"}
							onClick={this.usstr}>
							</div>
					
						<div className={this.ClassNameStrel[_10][2][serch_kanal] ? "video__block__open" : "video__block__close"} style={{ height: this.state.ClassNameStrel._3[1] }}>
							{this.grid__video__system()}
						</div>
